// Doctorhome.js
import React from 'react';

const DoctorHome = () => {
  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Welcome, Doctor!</h1>
      <p style={styles.subtitle}>You have access to your medical records and appointments.</p>
    </div>
  );
};

const styles = {
  container: {
    textAlign: 'center',
    padding: '50px',
    backgroundColor: '#87CEEB', // Light blue background color
  },
  title: {
    fontSize: '24px',
    color: '#333',
  },
  subtitle: {
    fontSize: '18px',
    color: '#555',
  },
};

export default DoctorHome;
